import React from 'react';
import { Progress, Card, Row, Col, Typography } from 'antd';
import '../../styles/Dashboard.css'; // Import your styles here

const { Title } = Typography;

const Dashboard = () => {
  // Hàm format hiển thị 938 kcal với 938 in đậm và kcal bên dưới
  const calorieFormat = (calories) => (
    <div style={{ fontSize: '16px', lineHeight: '1' }}>
      <strong style={{ display: 'block', fontSize: '20px', fontWeight: 'bold' }}>{calories}</strong>
      <span style={{ fontSize: '14px' }}>kcal</span>
    </div>
  );

  return (
    <div className="dashboard">
      {/* Title for Energy Summary */}
      <Title level={2} className="section-title">
        Energy Summary
      </Title>

      {/* Energy Summary Section */}
      <Row gutter={[16, 16]} className="energy-summary">
        <Col xs={24} sm={12}>
          <Card className="energy-card" bordered={false}>
            {/* Progress with yellow color */}
            <Progress
              type="circle"
              percent={50}
              strokeColor="yellow"  
              format={() => calorieFormat(938)}  
              width={100}
            />
            <p>Calorie consumed</p>
          </Card>
        </Col>
        <Col xs={24} sm={12}>
          <Card className="energy-card" bordered={false}>
            {/* Progress with red color */}
            <Progress
              type="circle"
              percent={50}
              strokeColor="red"  
              format={() => calorieFormat(938)} 
              width={100}
            />
            <p>Calorie remaining</p>
          </Card>
        </Col>
      </Row>

     
      <Title level={2} className="section-title">
        Macro Targets
      </Title>

      {/* Macro Targets Section */}
      <Row gutter={[16, 16]} className="macro-targets">
        <Col xs={24} sm={8}>
          <Card className="macro-card" bordered={false}>
            <div className="progress-container">
              <Progress
                type="circle"
                percent={75}
                strokeColor="black"  
                strokeWidth={10}
                format={() => '75%'}
                width={70}
              />
              <div className="progress-info">
                <p>345/453 (g)</p>
                <p>Protein</p>
              </div>
            </div>
          </Card>
        </Col>
        <Col xs={24} sm={8}>
          <Card className="macro-card" bordered={false}>
            <div className="progress-container">
              <Progress
                type="circle"
                percent={75}
                strokeColor="black"  
                strokeWidth={10}
                format={() => '75%'}
                width={70}
              />
              <div className="progress-info">
                <p>345/453 (g)</p>
                <p>Net Carb</p>
              </div>
            </div>
          </Card>
        </Col>
        <Col xs={24} sm={8}>
          <Card className="macro-card" bordered={false}>
            <div className="progress-container">
              <Progress
                type="circle"
                percent={75}
                strokeColor="black"  
                strokeWidth={10}
                format={() => '75%'}
                width={70}
              />
              <div className="progress-info">
                <p>345/453 (g)</p>
                <p>Fat</p>
              </div>
            </div>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Dashboard;
